const vector<string> dict = {"lnl","ljh","pn","hj","lj","fd","ZY","dc","jh","XW","TU","fe","XY","aZ","ln","lh","ab","fh","aY","XV","VW","db","pr","SR","QR"};
const string base64_chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

vector<int> S[1079];

int from_base_64(char base64_c) {
    if(base64_c >= 'A' && base64_c <= 'Z')
        return base64_c-'A';
    if(base64_c >= 'a' && base64_c <= 'z')
        return base64_c-'a'+26;
    throw exception();
}

void decode(){
    for(int s = 0; s < encoded_s.size(); ++s){
        S[s].push_back(1);
        const string& str = encoded_s[s];
        for(int i = 0; i < str.size(); ++i){
            int dict_idx = (int)str[i] - '0';
            if(dict_idx >= -8 && dict_idx <= -1)
                dict_idx += 25;
            if(str[i] >= 40 && str[i] <= 64){
                for(int d = 0; d < dict[dict_idx].size(); ++d)
                    S[s].push_back(pow(from_base_64(dict[dict_idx][d]),2) - S[s].back());
                continue;
            }
            S[s].push_back(pow(from_base_64(str[i]),2) - S[s].back());
        }
    }
}



int main(){
    decode();
    for(int i = 0 ; i < 1079; ++i){
        assert(real_s[i].size() == S[i].size());
        for(int j = 0; j < real_s[i].size(); ++j){
            assert(real_s[i][j] == S[i][j]);
        }
    }
    printf("success\n");
}